import React from 'react'
import styled from 'styled-components'


const Main = styled.div`
    background-color: white;
    display: grid;
    grid-template-rows: 80% 20%;
    width: 100%;
    margin: 2% 0%;
    border-radius: 5px;
    &:hover{
        cursor: pointer;
    }

`

const DivMessage = styled.div`
    width: 100%;
    padding: 10px 20px;
`

const Card = (props) => {
    return(
        <Main>
            <DivMessage>
                {props.message}
            </DivMessage>
        </Main>
    )
}

export default Card
